import React, { useState } from "react";
import { Container, Typography, Grid, Paper, AppBar, Toolbar, Button, Drawer, List, ListItem, ListItemText } from "@mui/material";
import Pantry from "./components/Pantry/Pantry";
import Profile from "./components/Profile/Profile";
import RecipeSuggestions from "./components/RecipeSuggestions/RecipeSuggestions";
import ShoppingList from "./components/ShoppingList/ShoppingList";
import "./App.css";
import pantryLogo from "./assets/pantry-logo.png";

function App() {
  const [pantryItems, setPantryItems] = useState([]);
  const [dietPreferences, setDietPreferences] = useState({
    diet: "None",
    restrictions: "",
  });
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [currentPage, setCurrentPage] = useState("Pantry Management"); // Set initial page state

  const updatePantryItems = (items) => {
    setPantryItems(items);
  };

  const updateDietPreferences = (diet, restrictions) => {
    setDietPreferences({ diet, restrictions });
  };

  const updateProfile = (profileData) => {
    setDietPreferences({
      diet: profileData.diet,
      restrictions: profileData.restrictions,
    });
  };

  const handleDrawerOpen = () => {
    setDrawerOpen(true);
  };

  const handleDrawerClose = () => {
    setDrawerOpen(false);
  };

  const handleNavigation = (page) => {
    setCurrentPage(page);
    setDrawerOpen(false);
  };

  const renderCurrentPage = () => {
    switch (currentPage) {
      case "Profile":
        return <Profile updateProfile={updateProfile} updateDietPreferences={updateDietPreferences} />;
      case "Shopping List":
        return <ShoppingList pantryItems={pantryItems} dietPreferences={dietPreferences} />;
      case "Pantry Management":
        return <Pantry updatePantryItems={updatePantryItems} />;
      case "Recipe Suggestions":
        return <RecipeSuggestions pantryItems={pantryItems} dietPreferences={dietPreferences} />;
      default:
        return <Pantry updatePantryItems={updatePantryItems} />;
    }
  };

  return (
    <Container maxWidth="lg" style={{ marginTop: "40px" }}>
      {/* AppBar for main menu */}
      <AppBar position="static" color="primary">
        <Toolbar>
          <img src={pantryLogo} alt="Pantry Logo" style={{ width: "40px", height: "40px", marginRight: "10px" }} />
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            Smart Pantry Manager
          </Typography>
          <Button color="inherit" onClick={handleDrawerOpen}>
            Menu
          </Button>
        </Toolbar>
      </AppBar>

      {/* Drawer for navigation */}
      <Drawer anchor="left" open={drawerOpen} onClose={handleDrawerClose}>
        <List>
          <ListItem button onClick={() => handleNavigation("Profile")}>
            <ListItemText primary="Profile" />
          </ListItem>
          <ListItem button onClick={() => handleNavigation("Shopping List")}>
            <ListItemText primary="Shopping List" />
          </ListItem>
          <ListItem button onClick={() => handleNavigation("Pantry Management")}>
            <ListItemText primary="Pantry Management" />
          </ListItem>
          <ListItem button onClick={() => handleNavigation("Recipe Suggestions")}>
            <ListItemText primary="Recipe Suggestions" />
          </ListItem>
        </List>
      </Drawer>

      {/* Render the current page */}
      <Grid container spacing={3} style={{ marginTop: "20px" }}>
        <Grid item xs={12}>
          <Paper elevation={3} style={{ padding: "20px", minHeight: "300px" }}>
            {renderCurrentPage()}
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
}

export default App;
